import React from 'react';
import LoginForm from './component/LoginForm/LoginForm';
import Footer from './component/NavBar/Footer';
import "./App.scss";

function App() {
  return (
    <div className="App">
    <image src="./Images/icon.png" alt="Logo.png"></image>
     <h1>Welcome to Student Mind</h1>
     <LoginForm/>
     <Footer/>
    </div>
  );
}

export default App;
